    private initDefaultQueryCommand() &#123;
        this.queryCommand = &#123;
            first: 0,
            rows: 10,
            sortOrder: 1,
            filters: []
        &#125;;
        this.filter = &#123;
            customerCode: null,
            id: null,
            orderDate: null,
            requiredDate: null,
            shippedDate: null
